import './App.css';
import React from 'react';
import styled from 'styled-components'; 
import theme from './theme';
import Nav from './Nav';
import { useParams } from 'react-router-dom';
import data from './Documents.json';

const {fonts} = theme;
const {colors} = theme;
function Documents(props) {
    const Container = styled.div`
        width: 100vw;
        height: 80vw;
        background-color: ${colors.lightBeige};
        
        justify-content: center;

    `
    const FileNav = styled.div`
        width = 20vw;
        height = 40vw;
        background-color: ${colors.tan};
        display:flex;
        flex-direction:column;
    `
    const Frame = styled.iframe`
        width: 80vw;
        height: 80vw;
    
    `
    const {subject} = useParams();
    let subjectData = undefined;
    if(subject in data){
        subjectData = data[subject];

    }
    let tests = (subjectData? subjectData.tests:undefined);
    let notes = (subjectData? subjectData.notes:undefined);
    
    return  (
        <div>
            <Nav/>
            <Container>             
                <h1>{subject.charAt(0).toUpperCase()+subject.slice(1)}</h1>
                <FileNav>

                </FileNav>
            </Container>

        </div>
        
    );


}

export default Documents;
